svg.script:
function toggleLayer(name)
{
  var layer = document.getElementById(name);
  if (layer!=null)
  {
    if (layer.getAttribute("visibility")=="hidden")
    {
      layer.setAttribute("visibility", "visible");
    }
    else
    {
      layer.setAttribute("visibility", "hidden");
    }
  }
  else
  {
    alert("error no such layer");
  }
}

//default to layers irrigation, and septic off
toggleLayer('layer5');
toggleLayer('layer3');
